import React from "react";
import {
    ScreenContainer,
    SignUpButtonContainer,
    LogoImage
} from './styled'
import logo from "../../assets/logo.png"
import { Button } from "@material-ui/core";
import { useHistory } from "react-router";
import LoginForm from "./LoginForm";
import { goToSingUp } from '../../routers/coordinator';
import { useUnprotectedPage } from "../../hooks/useUnprotectedPage";

export default function Login({rightButtonText, setRightButtonText}) {
    useUnprotectedPage()

    const history = useHistory()

    return (
        <ScreenContainer>
            <LogoImage src={logo} />
            <LoginForm rightButtonText={rightButtonText} setRightButtonText={setRightButtonText}/>
            <SignUpButtonContainer>
                <Button onClick={() => goToSingUp(history)}
                    type={'submit'}
                    fullWidth
                    variant={'text'}
                    color={'primary'}
                >NÃ£o possui conta?Cadastre-se</Button>
            </SignUpButtonContainer>

        </ScreenContainer>
    );

};
